import React from 'react';

export default class NavBar extends React.Component{
    render(){
        const navbarContent = ['Designers', 'Shoes', 'Bags', 'Belts', 'Sale']
    return(
        <span style={decor.black}>
        <div style={{...decor.menu, ...decor.small}}>
            {
            navbarContent.map((ele)=>{
            return <div>{ele}</div>
            })
            }
        </div>
        </span>
    )
}
}

const decor = {
    black:{
        backgorundColor: 'black'
    },
    menu:{
        display: 'grid',
        gridTemplateColumns: 'repeat(5, 1fr)',
        alignItems: 'center',
        color: 'white',
        height: '40px',
    },
    small:{
        width: '70%',
        margin: 'auto'
    },
    sticky:{
        position: 'sticky',
        top: '0',
        zIndex: '1000'
    }
}
